import { useState } from 'react';

import './Weather.css';

function Weather() {

  const [zip, setZip ] = useState('paris');

  return (
    <div className="Weather">
      <form onSubmit={ e => {
          e.preventDefault()
      }}>
        <input 
          type="text"
          placeholder="enter zip"
          value={zip}
          onChange={ e => setZip(e.target.value) }
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Weather;
